     * @param {string} reponseJsonData - Relative url where is located the resource.
     * @param {string} error_not_found - String error which will be thrown on not_found error.
     */
    constructor(ogapi, source, entity, error_not_found) {
        super(ogapi, "provision/" + source, entity, error_not_found);
    }

}

/**
 * ACTION values allowed
 */
export const ACTION_ENUM = ['HARDWARE_RESET', 'SOFTWARE_RESET', 'COMMS_DOWN', 'COMMS_UP', 'COMMS_RESET'];

'use strict';

import ProvisionGenericFinder from '../ProvisionGenericFinder';

/**
 *   This class allow make get request to certificate resource into Opengate North API.
 */
export default class BundleFinder extends ProvisionGenericFinder {

    /**     
     * @param {InternalOpenGateAPI} Reference to the API object.
     */
    constructor(ogapi) {
        super(ogapi, 'bundles', 'bundle', 'Bundle not found');
    }

    /**
     * @return {String} This returns a string with the URL of the request.
     * @private
     */
    _composeUrl() {
        //console.log(this._baseUrl + "/" + this._name + "/versions/" + this._version);
        return this._baseUrl + "/" + this._name + "/versions/" + this._version;
    }

    /**
     * Download a specific bundle by its name and version. This execute a GET http method
     * @test
     *   ogapi.newBundleFinder().findByNameAndVersion('bundlename', 'xxx-xx-xxx-xxx').then().catch();
     * @param {string} name - bundle name .
     * @param {string} version - bundle version.
     * @return {Promise} 
     */
    findByNameAndVersion(name, version) {
        this._name = name;
        this._version = version;
        return this._execute();
    }
}

'use strict';

