        this._description = description;
        return this;
    }

    /**
     * Add a flavor. If the field datastreams have value, they will add to this flavor
     * @param {!string} flavour
     * @param {Array} datastreams
     * @return {IoTProfilesHelper}
     */
    addFlavour(flavour, datastreams) {
        this._isValidString(flavour, 'flavour', 100);
        this._flavours.forEach(function(_flavour, index) {
            if (_flavour.name === flavour) {
                throw new Error('Flavour ' + flavour + ' already exists.');
            }
        });
        let _flavour = new IoTFlavour(this._ogapi, flavour);
        if (datastreams && datastreams.length > 0)
            _flavour.addDatastreams(datastreams);
        this._flavours.push(_flavour._composeElement());
        return this;
    }

    /**
     * Add a datastream to the indicated flavour 
     * @param {!string} flavour
     * @param {!object} datastream
     * @return {IoTProfilesHelper}
     */
    addDatastream(flavour, datastream) {
        this._isValidString(flavour, 'flavour', 100);
        //Buscamos flavour y si existe se añade a la lista de flavours
        var exists_flavour = -1;
        this._flavours.forEach(function(_flavour, index) {
            if (_flavour.name === flavour) {
                exists_flavour = index;
            }
        });
        if (exists_flavour === -1) {
            throw new Error('Flavour ' + flavour + ' not exists for this profile. Use addFlavour instead.');
        }
        this._flavours[exists_flavour].datastreams.push(datastream);
        return this;
    }

    /**
     * Remove flavour
     * @param {!string} flavour
     * @return {IoTProfilesHelper}
     */
    removeFlavour(flavour) {
        this._isValidString(flavour, 'flavour', 100);
        var remove_index = -1;
        this._flavours.forEach(function(_flavour, index) {
            if (_flavour.name === flavour)
                remove_index = index;
        });
        if (remove_index === -1) {
            throw new Error('Flavour ' + flavour + ' not exists for this profile');
        }
        if (this._flavours.length === 1) {
            throw new Error('Flavour ' + flavour + ' can\'t remove, profile can\'t be empty');
        }
        this._flavours.splice(remove_index, 1);
        return this;
    }

    /**
     * Remove datastream to the indicated flavour
     * @param {!string} flavour
     * @param {!string} id_datastream of datastream
     * @return {IoTProfilesHelper}
     */
    removeDatastream(flavour, id_datastream) {
        this._isValidString(flavour, 'flavour', 100);
        let remove_flavour_index = -1;
        let remove_datastream_index = -1;
        this._flavours.forEach(function(_flavour, flavour_index) {
            if (_flavour.name === flavour) {
                remove_flavour_index = flavour_index;
                _flavour.datastreams.forEach(function(datastream, datastream_index) {
                    if (datastream.id === id_datastream) {
                        remove_datastream_index = datastream_index;
                    }
                })
            }
        });
        if (remove_flavour_index === -1) {
            throw new Error('Flavour ' + flavour + ' not exists for this profile');
        }
        if (remove_datastream_index === -1) {
            throw new Error('Datastream ' + id_datastream + ' not exists for this profile and flavour ' + flavour);
        }
        if (this._flavours[remove_flavour_index].datastreams.length === 1) {
            throw new Error('Datastream ' + id_datastream + ' can\'t remove, flavour ' + flavour + ' can\'t be empty');
        }
        this._flavours[remove_flavour_index].datastreams.splice(remove_datastream_index, 1);
        let _flavour = new IoTFlavour(this._ogapi, flavour, this._flavours[remove_flavour_index].datastreams);
        this._flavours.splice(remove_flavour_index, 1);
        this._flavours.push(_flavour._composeElement());
        return this;
    }

    /**
     * Update flavour name
     * @param {!string} old_flavour name
     * @param {!string} new_flavour name
     * @return {IoTProfilesHelper}
     */
    updateFlavour(old_flavour, new_flavour) {
        this._isValidString(new_flavour, 'new flavour', 100);
        this._isValidString(old_flavour, 'old flavour', 100);
        let old_flavour_index = -1;
        let new_flavour_index = -1;
        this._flavours.forEach(function(flavour, index) {
            switch (flavour.name) {
                case old_flavour:
                    old_flavour_index = index;
                    break;
                case new_flavour:
                    new_flavour_index = index;
                    break;
            }
        });
        if (new_flavour_index != -1) {
            throw new Error('New flavour ' + flavour + ' already exists.');
        }
        if (old_flavour_index === -1) {
            throw new Error('Flavour ' + old_flavour + ' not exists for this profile.');
        }
        this._flavours[old_flavour_index].name = new_flavour;
        return this;
    }

    /**
     * Update datastream to the indicated flavour
     * @param {!string} flavour
     * @param {!string} id_datastream of datastream
     * @param {!Object} datastream json object
     * @return {IoTProfilesHelper}
     */
    updateDatastream(flavour, id_datastream, datastream) {
        this._isValidString(flavour, 'flavour', 100);
        this._isValidString(id_datastream, 'id datastream', 100);
        if (!datastream || typeof datastream !== 'object') {
            throw new Error('Datastream must be an object');
        }
        let update_flavour_index = -1;
        let update_datastream_index = -1;
        this._flavours.forEach(function(_flavour, flavour_index) {
            if (_flavour.name === flavour) {
                update_flavour_index = flavour_index;
                _flavour.datastreams.forEach(function(_datastream, datastream_index) {
                    if (_datastream.id === id_datastream) {
                        update_datastream_index = datastream_index;
                    }
                });
            }
        });
        if (update_flavour_index === -1) {
            throw new Error('Flavour ' + flavour + ' not exists for this profile. Create it, use method addFlavour instead');
        }
        if (update_datastream_index === -1) {
            throw new Error('Datastream ' + id_datastream + ' not exists for this profile and flavour ' + flavour + '. Create it, use method addDatastream instead.');
        }
        this._flavours[update_flavour_index].datastreams[update_datastream_index] = datastream;
        return this;
    }

    _composeElement() {

        if (this._flavours.length === 0) {
            let _flavour = new IoTFlavour(this._ogapi, this._name + 'ExampleFlavour');
            let _datastream = this._ogapi.IoTDatastreamsBuilder();
            _datastream.withId(this._name + 'ExampleDatastream');
            _datastream.withName(this._name + 'ExampleDatastream');
            _datastream.withDescription('Example datastream');
            _datastream.withPeriod('INSTANT');
            _datastream.withUnit('EG', 'example', 'e.g.');
            _datastream.withTags(['example']);
            _flavour.addDatastream(_datastream.build());
            this._flavours.push(_flavour._composeElement());
        }

        return {
            'name': this._name,
            'version': this._version,
            'description': this._description,
            'flavours': this._flavours
        }
    }

    _buildURL() {
        return this._resource + '/' + this._organization + POST_RESOURCE + '/' + this._id;
    }
    /**
     * Create not supported on this builder. Use IoTProfileHelper instead.
     */
    create() {
        throw new Error('Create not supported on this builder. Use IoTProfilesBuilder instead.');
    }

    _isValidString(string, param_name, max_length) {
        if (typeof string !== 'string' || string.length === 0 || string.length > max_length)
            throw new Error('Parameter ' + param_name + ' must be a string, cannot be empty and has a maximum length of ' + max_length + ' on IoTProfilesHelper');
    }
}

'use strict';

import q from 'q';
import moment from 'moment';

const JOB_RESOURCE = "/jobs/";
const TASK_RESOURCE = "/tasks/";
const LIMIT_SIZE_DEF_VALUE = 10;

export default class OperationActions {

    /**
     * @param {InternalOpenGateAPI} ogapi - this is configuration about Opengate North API.
     * @param {string} operationId - Identifier of the operation on which the action will be carried out
     */
    constructor(ogapi, operationId) {
        if (typeof operationId !== 'string')
            throw new Error('Parameter operationId must be a string');
        this._ogapi = ogapi;
        this._resource = 'operation';
        this._operationId = operationId;
    }

    /**
     * This invoke a request to OpenGate North API and the callback is managed by promises
     * This function active an operation
     * @example 
     * ogapi.newOperationActions("xxxxx-xxx-xxxx-xxxxx").active()
     * @return {Promise} 
     * @property {function (statusCode:number)} then - When request it is OK
     * @property {function (errors:array, statusCode:number)} then - When request it is NOK
     * @property {function (errors:array)} catch - When request it is NOK
     */
    active() {
        let config = {
            request: {
                active: true
            }
        };
        this._key = "job";
        this._resource = this._resource + JOB_RESOURCE + this._operationId;
        //console.log("active with config: " + JSON.stringify(config));
        return this._update(config);
    }

    /**
     * This invoke a request to OpenGate North API and the callback is managed by promises
     * This function pause an operation
     * @example 
     * ogapi.OperationActions("xxxxx-xxx-xxxx-xxxxx").pause()
     * @return {Promise} 
     * @property {function (statusCode:number)} then - When request it is OK
     * @property {function (errors:array, statusCode:number)} then - When request it is NOK
     * @property {function (errors:array)} catch - When request it is NOK
     */
    pause() {
        let config = {
            request: {
                active: false
            }
        };
        this._key = "job";
        this._resource = this._resource + JOB_RESOURCE + this._operationId;
        //console.log("pause with config: " + JSON.stringify(config));
        return this._update(config);
    }

    /**
     * This invoke a request to OpenGate North API and the callback is managed by promises
     * This function cancela operation
     * @return {Promise}
     * @property {function (result:object, statusCode:number)} then - When request it is OK
     * @property {function (errors:array, statusCode:number)} then - When request it is NOK
     * @property {function (errors:array)} catch - When request it is NOK
     * @example
     * Actions("xxxxx-xxx-xxxx-xxxxx").cancel();
     */
    cancel() {
        //console.log("cancel");
        this._id = this._operationId;
        this._resource = this._resource + JOB_RESOURCE + this._id;
        return this._cancel(this._resource);
    }

    /**
     * This invoke a request to OpenGate North API and the callback is managed by promises
     * This function active periodicity of an operation
     * @example 
     * ogapi.newOperationActions("xxxxx-xxx-xxxx-xxxxx").activePeriodicity()
     * @return {Promise} 
     * @property {function (statusCode:number)} then - When request it is OK
     * @property {function (errors:array, statusCode:number)} then - When request it is NOK
     * @property {function (errors:array)} catch - When request it is NOK
     */
    activePeriodicity() {
        let config = {
            active: true
        };

        this._key = "task";
        this._resource = this._resource + TASK_RESOURCE;
        //console.log("active with config: " + JSON.stringify(config));
        return this._periodicityActions("ACTIVE", config);
    }

    /**
     * This invoke a request to OpenGate North API and the callback is managed by promises
     * This function pause periodicity of an operation
     * @example 
     * ogapi.OperationActions("xxxxx-xxx-xxxx-xxxxx").pausePeriodicity()
     * @return {Promise} 
     * @property {function (statusCode:number)} then - When request it is OK
     * @property {function (errors:array, statusCode:number)} then - When request it is NOK
     * @property {function (errors:array)} catch - When request it is NOK
     */
    pausePeriodicity() {
        let config = {
            active: false
        };
        //console.log("pause with config: " + JSON.stringify(config));
        this._key = "task";
        this._resource = this._resource + TASK_RESOURCE;
        //console.log("PAUSE_PERIODICITY_resource: " + this._resource);
        return this._periodicityActions("PAUSE", config);
    }

    /**
     * This invoke a request to OpenGate North API and the callback is managed by promises
     * This function cancel the periodicity of an operation
     * @return {Promise}
     * @property {function (result:object, statusCode:number)} then - When request it is OK
     * @property {function (errors:array, statusCode:number)} then - When request it is NOK
     * @property {function (errors:array)} catch - When request it is NOK
     * @example
     * ogapi.OperationActions("xxxxx-xxx-xxxx-xxxxx").cancelPeriodicity();
     */
    cancelPeriodicity() {
        //console.log("cancel");
        this._resource = this._resource + TASK_RESOURCE;
        return this._periodicityActions("CANCEL");
    }

    /**
     * This invoke a request to OpenGate North API and the callback is managed by promises
     * This function pause, update its delay and active an operation for execute immediately
     * @example 
     * ogapi.OperationActions("xxxxx-xxx-xxxx-xxxxx").executeNow()
     * @return {Promise} 
     * @property {function (statusCode:number)} then - When request it is OK
     * @property {function (errors:array, statusCode:number)} then - When request it is NOK
     * @property {function (errors:array)} catch - When request it is NOK
     */
    executeNow() {
        let config = {
            request: {
                schedule: {
                    start: {}
                }
            }
        };
        //console.log("executeNow with config: " + JSON.stringify(config));
        return this._readAndUpdate(config, true);
    }

    /**
     * This invoke a request to OpenGate North API and the callback is managed by promises
     * This function pauses (if it was active), updates the delay and passes the operation to the initial state (if activated, activated again)
     * @example 
     * ogapi.OperationActions("xxxxx-xxx-xxxx-xxxxx").executeLater(10)
     * @param {!number} minutes 
     * @return {promise} 
     * @property {function (statusCode:number)} then - When request it is OK
     * @property {function (errors:array, statusCode:number)} then - When request it is NOK
     * @property {function (errors:array)} catch - When request it is NOK
     */
    executeLater(minutes) {
        //console.log("typeof minutes: " + typeof (minutes));
        if (typeof minutes !== "number") {
            throw new Error("Parameter minutes must be typeof number");
        }
        let config = {
            request: {
                schedule: {
                    start: {
                        delayed: moment.duration(minutes, 'minutes').asMilliseconds()
                    }
                }
            }
        };
        //console.log("executeLater with config: " + JSON.stringify(config));
        return this._readAndUpdate(config);
    }

    /**
     * This invoke a request to OpenGate North API and the callback is managed by promises
     * This function pauses (if it was active), updates the callback and passes the operation to the initial state (if activated, activated again)
     * @example 
     * ogapi.OperationActions("xxxxx-xxx-xxxx-xxxxx").changeCallback("http://[your_application_address]/[your_URI]")
     * @param {!string} url 
     * @return {promise} 
     * @property {function (statusCode:number)} then - When request it is OK
     * @property {function (errors:array, statusCode:number)} then - When request it is NOK
     * @property {function (errors:array)} catch - When request it is NOK
     */
    changeCallback(url) {
        if (typeof url !== "string")
            throw new Error('Parameter url must be a string');
        let config = {
            request: {
                callback: url
            }
        };
        //console.log("changeCallback with config: " + JSON.stringify(config));
        return this._readAndUpdate(config);
    }

    _cancel() {
        //console.log("cancel");
        var defered = q.defer();
        var promise = defered.promise;
        this._ogapi.Napi.delete(this._resource)
            .then((response) => {
                //console.log("cancel response: " + JSON.stringify(response));
                if (response.statusCode === 200) {
                    defered.resolve({ statusCode: response.statusCode, data: { id: this._id } });
                } else {
                    defered.reject({ errors: response.errors, statusCode: response.statusCode });
                }
            })
            .catch((error) => {
                //console.log("cancel error: " + JSON.stringify(error));
                defered.reject(this._formatError(error));
            });
        return promise;
    }

    _periodicityActions(action, config) {
        //console.log("_periodicityActions");
        var _this = this;
        var defered = q.defer();
        var promise = defered.promise;
        //console.log(_this._operationId);
        //console.log("OPERATION_ID: " + this._operationId);
        _this._ogapi.newOperationFinder().findById(_this._operationId)
            .then(function (response) {
                var data = response.data;
                if (!data || Object.keys(data).length == 0) {
                    //console.log("BUG");
                    //BUG http://cm.amplia.es/jira/browse/ODMQA-1057
                    defered.reject({ errors: "Operation with id " + _this._operationId + " not exists" });
                } else {
                    //console.log("RESPONSE_DATA: " + JSON.stringify(data));
                    let periodicityId = data.taskId;
                    if (!periodicityId) {
                        defered.reject({ errors: "Operation is not periodic!" });
                    } else {
                        _this._resource = _this._resource + periodicityId;
                        //console.log("RESOURCE_DATA: " + _this._resource);
                        switch (action) {
                            case "PAUSE":
                            case "ACTIVE":
                                _this._update(config)
                                    .then(function (response) {
                                        defered.resolve(response);
                                    }).catch(function (error) {
                                        defered.reject(error);
                                    });
                                break;
                            case "CANCEL":
                                _this._id = periodicityId;
                                _this._cancel()
                                    .then(function (response) {
                                        defered.resolve(response);
                                    }).catch(function (error) {
                                        defered.reject(error);
                                    });
                                break;
                            default:
                                defered.reject({ errors: "Not implemented action: " + action });
                        }
                    }
                }
            })
            .catch(function (error) {
                //console.log("ERROR: " + error);
                defered.reject(error);
            });
        return promise;
    }

    /**
     * This invoke a request to OpenGate North API and the callback is managed by promises
     * This function read and update an operation
     * @example 
     * ogapi.OperationActions("xxxxx-xxx-xxxx-xxxxx")._readAndUpdate({})
     * @param {object} - config 
     * @param {boolean} - forceToActivate
     * @return {Promise} 
     * @property {function (statusCode:number)} then - When request it is OK
     * @property {function (errors:array, statusCode:number)} then - When request it is NOK
     * @property {function (error:string)} catch - When request it is NOK
     */
    _readAndUpdate(config, forceToActivate) {
        //console.log("_readAndUpdate with config: " + JSON.stringify(config) + " and forceToActivate: " + forceToActivate);
        let defered = q.defer();
        let promise = defered.promise;
        var _this = this;
        _this._ogapi.newOperationFinder().findById(_this._operationId).then(
            function (response) {
                //console.log("_readAndUpdate find response: " + JSON.stringify(response));
                var data = response.data;
                if (!data) {
                    //BUG http://cm.amplia.es/jira/browse/ODMQA-1057
                    defered.reject("Operation with id " + _this._operationId + " not exists");
                } else if (active) {
                    _this.pause().then(
                        function (response) {
                            _this._update(config, forceToActivate || active).then(
                                function (response) {
                                    defered.resolve(response);
                                }
                            ).catch(
                                function (error) {
                                    defered.reject(_this._formatError(error));
                                }
                                );
                        }
                    ).catch(
                        function (error) {
                            defered.reject(_this._formatError(error));
                        }
                        )

                } else {
                    _this._update(config, forceToActivate || active).then(
                        function (response) {
                            defered.resolve(response);
                        }
                    ).catch(
                        function (error) {
                            defered.reject(_this._formatError(error));
                        }
                        );
                }
            }
        ).catch(
            function (error) {
                //console.log("_readAndUpdate find error: " + JSON.stringify(error));
                defered.reject(_this._formatError(error));
            }
            );

        return promise;
    }

    /**
     * This invoke a request to OpenGate North API and the callback is managed by promises
     * This function update an operation
     * @example 
     * ogapi.OperationActions("xxxxx-xxx-xxxx-xxxxx")._update({})
     * ogapi.OperationActions("xxxxx-xxx-xxxx-xxxxx")._update({}, _defered, _promise)
     * @return {Promise} 
     * @property {function (statusCode:number)} then - When request it is OK
     * @property {function (errors:array, statusCode:number)} then - When request it is NOK
     * @property {function (error:string)} catch - When request it is NOK
     */
    _update(config, forceToActivate) {
        //console.log("_update with config: " + JSON.stringify(config) + " and forceToActivate: " + forceToActivate);
        //console.log("_update: " + JSON.stringify(config));
        var _this = this;
        let defered = q.defer();
        let promise = defered.promise;
        let obj = {};
        //console.log("_update_key: " + _this._key);
        obj[_this._key] = config;
        //console.log("_update_obj: " + JSON.stringify(obj));
        //console.log("_update_resource: " + this._resource);
        this._ogapi.Napi
            .put(this._resource, obj)
            .then((response) => {
                //console.log("_update response: " + JSON.stringify(response));
                if (forceToActivate) {
                    _this.active().then(
                        function (response) {
                            defered.resolve(response);
                        }
                    ).catch(
                        function (error) {
                            defered.reject(this._formatError(error));
                        }
                        );
                } else {
                    if (response.status === 200) {
                        let data = response.text != "" ? JSON.parse(response.text) : {};
                        let _response = { statusCode: response.status, data: data };
                        defered.resolve(response);
                    } else {
                        defered.reject({ errors: response.errors, statusCode: response.status });
                    }
                }
            })
            .catch((error) => {
                //console.log("_update error: " + error);
                defered.reject(this._formatError(error));
            });
        return promise;
    }

    _formatError(error) {
        if (!error.data) {
            error["data"] = {};
        }
        if (!error.data.errors) {
            error.data["errors"] = [(typeof (error) === "string") ? { message: error } : error];
        }
        //console.log("_formatError: " + error);
        return error;
    }


}

'use strict';

import GenericFinder from '../GenericFinder';

