import merge from 'merge';
import moment from 'moment';
/**
* Defines the builder to configure a period of operation. With this builder you can select how repeat the operation. By days, hours or minutes.
*/
export default class ExecuteEachBuilder {
	/**
	* @param {!BaseOperationBuilder} parent - this is a operationBaseBuilder.
	* @param {!Date} date - Date when operation will be executed
	* @param {string} periodicityName - Name associated to periodicity	
	* @param {!number or Date} end - When periodicity ends. By repetitions or by date	
	*/
	constructor(parent, date, periodicityName, end) {
		this._parent = parent;
		this._skeleton = {
			start: date,
			stop: end,
			name: periodicityName,
			repeating: {
				period: {
					each: undefined,
					unit: undefined
				}
			}
		};
		if (typeof end !== "undefined") {
			let stop;
			if (typeof end === "number") {
				if (end <= 0) {
					throw new Error("Invalid stop value. Number of repetitions must be greater than 0.");
				}
				stop = {
					"executions": end
				};
			} else if (end.constructor === Date) {
				let startDate = moment(date);
				let stopDate = moment(end);
				if (moment.max(startDate, stopDate) == startDate) {
					throw new Error("Invalid stop date on executeEach method. Start date must be earlier than stop date.");
				}
				stop = {
					"date": end
				};
			}
			this._skeleton.stop = stop;
		}
	}
	/**
	* Set a difference of minutes in each repetition
	* @param {number} minutes
	* @return {BaseOperationBuilder}
	*/
	minutes(minutes) {
		const type = "MINUTES";
		if (typeof minutes !== "number") {
			throw new Error("Parameter minutes must be typeof number");
		}
		return this._addPeriod(minutes, type);
	}
	/**
	* Set a difference of hours in each repetition
	* @param {number} hours
	* @return {BaseOperationBuilder}
	*/
	hours(hours) {
		const type = "HOURS";
		if (typeof hours !== "number") {
			throw new Error("Parameter hours must be typeof number");
		}
		return this._addPeriod(hours, type);
	}
	/**
	* Set a difference of days in each repetition
	* @param {number} days
	* @return {BaseOperationBuilder}
	*/
	days(days) {
		const type = "DAYS";
		if (typeof days !== "number") {
			throw new Error("Parameter days must be typeof number");
		}
		return this._addPeriod(days, type);
	}

	_addPeriod(num, type) {
		let skeleton = merge(true, this._skeleton);
		skeleton.repeating.period.each = num;
		skeleton.repeating.period.unit = type;
		this._parent._build.task = skeleton;
		return this._parent;
	}
}

import moment from 'moment';
import merge from 'merge';
import { TIME_FORMAT } from './../../../util/DATE_FORMAT';

import { MONTHS_ENUM } from './MONTHS_ENUM';

import ByWeek from './pattern/ByWeek';
import ByYear from './pattern/ByYear';
import ByMonth from './pattern/ByMonth';
import ByGeneric from './pattern/ByGeneric';

/**
* Defines the builder to configure a period of operation. By this builder you can select period by day, week, month, year.
*/
export default class ExecuteEveryBuilder {
	/**
	* @param {!BaseOperationBuilder} parent - this is a operationBaseBuilder.
	* @param {!Date} date - Date when operation will be executed
	* @param {string} periodicityName - Name associated to periodicity	
	*/
	constructor(parent, date, periodicityName, end) {
		this.year = new ByYear(parent, date, periodicityName, end);
		this.week = new ByWeek(parent, date, periodicityName, end);
		this._day = new ByGeneric(parent, date, periodicityName, end);
		this._date = date;
		this._end = end;
		this._parent = parent;
		this._periodicityName = periodicityName;
	}

	/**
	* Every day at time defined will be the pattern
	* @return {BaseOperationBuilder}
	*/
	day() {
		return this._day._build();
	}

	/**
	* Each month at time and day defined will be the pattern
	* @param {array} months - months on will be execute the operation
	* @throws {Error} throw error when months is not typeof Array
	* @throws {Error} throw error when any month is not found into MONTHS_ENUM
	* @return {ByMonth}
	*/
	month(months) {
		var _task = this._parent._task;
		if (typeof months === "undefined" || months.constructor !== Array) {
			var error = true;
			if (_task) {
				var pattern = _task.schedule.repeating.pattern;
				if (pattern) {
					var monthly = pattern.monthly;
					if (monthly) {
						error = false;
						months = monthly.months;
					}
				}
			}
			if (error)
				throw new Error("Parameter months must be typeof Array");
		}
		if (months.length === 0) {
			throw new Error("Parameter months must have at least one month");
		}
		let not_found = [];
		for (var i = 0; i < months.length; i++) {
			let found = MONTHS_ENUM.find(function (month) { return month == this; }, months[i]);
			if (typeof found === "undefined") {
				not_found.push(found);
			}
		}
		if (not_found.length !== 0) {
			throw new Error("Any month into parameter months is not allowed. Parameter value <'" + JSON.stringify(not_found) + "'>, Months allowed <'" + JSON.stringify(MONTHS_ENUM) + "'>")
		}
		return new ByMonth(this._parent, this._date, this._periodicityName, months, this._end);
	}
}

