                } else {
                    //console.log("ERROR " + JSON.stringify(res.errors));
                    defered.reject({ errors: res.errors, statusCode: res.statusCode });
                }
            })
            .catch((error) => {
                console.log("ERROR2 " + JSON.stringify(this._name) + JSON.stringify(error));
                defered.reject(error);
            });
        return promise;
    }
}

